 lý), trong đó có một số bộ môn của Khoa đã có bề dày truyền thống như các Bộ môn Toán và Vật lý được thành lập từ ngày thành lập trường, và bộ môn CNPM và KHMT được phát triển từ Trung tâm Tin học thành lập từ đầu những năm 1980.','https://storage.googleapis.com/student-4a760.appspot.com/da2a47ae-a567-46f2-8cf5-ebc0451b79db.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547628110&Signature=KFj4irIIKaw%2F%2FF1tyi8wi2WSIW8eD7EjkxPOOvPzKyS1uZFNksrxkS0zA7S6a%2BcNep0UnjGyp835GYG020zM25hlxRsaJcpBzLMzKgHKIFfI2pzOKWQQNJda70YXiWM%2FtZpA1JDR%2BqjRPzm%2FnrL%2FdSddDCE5WdwC7bRl2MAPhjAg1yHlxUend3V8EtL2VKt8d0h0ydnNOJyoFsRLaOBIGmr3hw%2F8v7SaGLF8iS7JJeqy6B3yyjGCLx7VTc8IqrFcxLd6fwfybgq%2F32ahps%2BlmDiSI%2BWIBdtvrYKjebdUdVyN41k1IuMaw3XkIgaTAMZ%2FXexp%2B159uKU8sSh%2Fqh9hfA%3D%3D','HomeBody','Lịch sử phát triển'),(14,NULL,'https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','Swiper',NULL),(15,NULL,'https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3