ZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','Swiper',NULL),(23,NULL,'https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','Swiper',NULL),(24,'Hệ thống giảng đường trung tâm của Học viện Nông nghiệp Việt Nam đều được trang bị máy chiếu projector. Hệ thống phòng thực hành máy tính của khoa CNTT gồm có 05 phòng được trang bị thiết bị máy tính hiện đại, màn hình cỡ lớn hoặc projector, kết nối mạng Internet thông qua hệ thống mạng nội bộ của trường để đáp ứng nhu cầu học tập của sinh viên trong toàn trường.','https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','HomeBody','Cơ sở vật chất'),(25,'Các công trình NCKH trong lĩnh vực CNTT và CNTT ứng dụng cũng đã được thực hiện ngay từ những thời kỳ đầu tiên. Trong giai đoạn 1999-2005, các thầy cô cùng các em sinh viên trong Khoa đã thực hiện nhiều đề tài NCKH có tính ứng dụng cao, đóng góp vào sự nghiệp NCKH của nhà trường. Khoa đã xây dựng và ứng dụng thành công nhiều phần mềm trong nhiều lĩnh vực của nông nghiệp như quy hoạch sử dụng đất, GIS, viễn thám, sinh học, kinh tế, quản lý giáo dục. Trong giai đoạn 2006-2010, bên cạnh việc nâng cao chất lượng đào tạo nhân lực CNTT cho đất nước, Khoa CNTT đã xây dựng được định hướng NCKH của mình: Chú trọng các lĩnh vực Tin Sinh học, ứng dụng công nghệ GIS, viễn thám và mô hình mô phỏng trong quản lý và quy hoạch tài nguyên, thiết kế các phần mềm xử lý thống kê, tối ưu hóa và các công cụ phát triển kiểm thử phần mềm, phát triển các cổng thông tin điện tử phục vụ đào tạo và dịch vụ, xây dựng các hệ thống thông tin, các hệ cơ sở dữ liệu chuẩn và hệ hỗ trợ ra quyết định, các ứng dụng của Toán, Tin học và Vật lý trong sinh học và nông nghiệp và quản lý thông tin, phát triển và ứng dụng các phương pháp tính toán khoa học. Trong giai đoạn 2010-2019, các thầy cô cùng các em sinh viên trong Khoa đã thực hiện nhiều đề tài NCKH có tính ứng dụng cao, đóng góp vào sự nghiệp NCKH của nhà trường. Khoa đã xây dựng và ứng dụng thành công nhiều phần mềm trong nhiều lĩnh vực của nông nghiệp như quy hoạch sử dụng đất, GIS, viễn thám, sinh học, kinh tế, quản lý giáo dục.Trong giai đoạn tiếp theo, bên cạnh việc nâng cao chất lượng đào tạo nhân lực CNTT cho đất nước, Khoa CNTT đã xây dựng được định hướng NCKH của mình: Chú trọng các lĩnh vực Tin Sinh học, Xử lý ảnh, Trí tuệ nhân tạo, ứng dụng công nghệ GIS, viễn thám và mô hình mô phỏng trong quản lý và quy hoạch tài nguyên, thiết kế các phần mềm xử lý thống kê, tối ưu hóa và các công cụ phát triển kiểm thử phần mềm, phát triển các cổng thông tin điện tử phục vụ đào tạo và dịch vụ, xây dựng các hệ thống thông tin, các hệ cơ sở dữ liệu chuẩn và hệ hỗ trợ ra quyết định, các ứng dụng của Toán, Tin học và Vật lý trong sinh học và nông nghiệp và quản lý thông tin, phát triển và ứng dụng các phương pháp tính toán khoa học. Từ năm 2018, Khoa thành lập nhóm Nghiên cứu mạnh “Ứng dụng Công nghệ thông tin trong nông nghiệp” và đã đạt những thành tựu bước đầu, góp phần thúc đẩy tinh thần NCKH của các thành viên trong nhóm, tạo ra nhiều sản phẩm ứng dụng trong lĩnh vực Nông nghiệp.','https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','HomeBody','Các công trình nghiên cứu khoa học'),(26,'Phấn đấu trở thành một trung tâm đào tạo nhân lực công nghệ thông tin có uy tín cao trong nước. Phấn đấu trở thành một trung tâm nghiên cứu ứng dụng và phát triển công nghệ thông tin, đặc biệt trong lĩnh vực nông nghiệp và quản lý tài nguyên.','https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','HomeBody','Tầm Nhìn'),(27,'Là đơn vị có vai trò quan trọng của Học viện Nông nghiệp Việt Nam, đảm bảo đạt chất lượng cao trong đào tạo, khoa học công nghệ làm tốt vai trò tư vấn và cung cấp các giải pháp công nghệ thông tin.','https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','HomeBody','Sứ Mệnh'),(28,'Có điều gì thắc mắc hay đóng góp ý kiến cá nhân hãy gửi cho chúng tôi bạn sẽ nhận được giải đáp sớm nhất. Xin cảm ơn !','https://storage.googleapis.com/student-4a760.appspot.com/02e0f9d0-1775-492b-896f-84fe79c8edca.jpg?GoogleAccessId=firebase-adminsdk-60z3z@student-4a760.iam.gserviceaccount.com&Expires=6547629000&Signature=czsY7HNdrmOqidtV3JdpE7pftcDjo8zQLFIi0Gnn8POiDF7o5WOslqhPTXFa8XVsBfewrLxJ3rHssWxCUICpGSPYUJGukm0gkY9JuV76aDoE4%2FoamZwgpMarzsoBZTC80yAYoKgbT2rOtMpPRinFKDpp9w4LtMwab6x5GYyfMPXLcvt7V46tsqmEVeoPvimWMDnDbLGcYu4lEDWWzhTKK2TvpnWKftWs6qM3Gr0DwyZXUUBPMoahWMYeVdx17NpYZrEfDxnkoMCxK0JYFG7r7zI9Yzw0x%2F%2BP9ePtwuNFZQPnVzPDSu6NNCEOMMN4dffS2Wj9Er47bFohg4lVLcMPGg%3D%3D','HomeBody','NƠI TIẾP NHẬN PHẢN HỒI');
